var title_f17_24_17792="Loop ileostomy";
var content_f17_24_17792=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=SURG%2F70246&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=SURG%2F70246&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 562px\">",
"   <div class=\"ttl\">",
"    Loop ileostomy",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 542px; height: 533px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    (A) A segment of intestine is brought out above the abdominal wall assuring a tension-free placement.",
"    <br>",
"     (B) An enterotomy is created along the efferent (or distal) end of the loop stoma.",
"     <br>",
"      (C) Using absorbable maturation sutures, an everting proximal afferent end (left) and a flush distal efferent end (right) are created. This will allow the effluent to come through the proximal spout into the collecting bag system and prevent leakage onto the surrounding skin. The distal flush end will allow venting.",
"      <div class=\"footnotes\">",
"      </div>",
"      <div class=\"reference\">",
"      </div>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
