"   </div>",
"   <div class=\"block pha drugH1Div\" id=\"F236280\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Mechanism of Action",
"    </span>",
"    <p style=\"text-indent:0em;display:inline\">",
"     Zopiclone is a cyclopyrrolone derivative and has a pharmacological profile similar to benzodiazepines. Zopiclone reduces sleep latency, increases duration of sleep, and decreases the number of nocturnal awakenings.",
"    </p>",
"   </div>",
"   <div class=\"block phk drugH1Div\" id=\"F236297\" xmlns=\"file://www.w3.org/1999/xhtml\">",
"    <span class=\"drugH1\">",
"     Pharmacodynamics/Kinetics",
"    </span>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Distribution: V",
"     <sub>",
"      d",
"     </sub>",
"     : ~92-105 L; occurs rapidly from vascular compartment",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Protein binding: ~45%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Metabolism: Extensively hepatic via CYP3A4 and CYP2C8",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Bioavailability: &gt;75%; Elderly: 94%",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Half-life elimination: ~5 hours; Elderly: ~7 hours; Hepatic impairment: ~12 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Time to peak, serum: &lt;2 hours; Hepatic impairment: 3.5 hours",
"    </p>",
"    <p style=\"text-indent:-2em;margin-left:2em;text-align:justify;\">",
"     Excretion: Urine (75%; ~4% to 5% as unchanged drug); feces (16%)",
"    </p>",
"   </div>",
