var title_f17_24_17804="Drivers with CHD risk";
var content_f17_24_17804=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=PC%2F67184&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=PC%2F67184&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Recommendations for certification for commercial drivers with risk for CHD",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tr>",
"      <td class=\"subtitle1\">",
"       Diagnosis",
"      </td>",
"      <td class=\"subtitle1\">",
"       Physiologic/functional",
"      </td>",
"      <td class=\"subtitle1\">",
"       Certification",
"      </td>",
"      <td class=\"subtitle1\">",
"       Re-certification",
"      </td>",
"     </tr>",
"     <tr>",
"      <td>",
"       Asymptomatic, healthy",
"      </td>",
"      <td>",
"       <p>",
"        Low CHD event risk.",
"       </p>",
"       <p>",
"        Assess for clinically apparent risk factors.",
"       </p>",
"       <p>",
"        Use, when possible, Framingham risk score model to predict 10-year CHD event risk",
"       </p>",
"       <p>",
"        Increasing age is a surrogate marker for increasing atherosclerotic plaque burden",
"       </p>",
"      </td>",
"      <td>",
"       <p>",
"        Yes, if asymptomatic.",
"       </p>",
"       <p>",
"        Rarely disqualifying alone.",
"       </p>",
"      </td>",
"      <td>",
"       Biennial",
"      </td>",
"     </tr>",
"     <tr>",
"      <td rowspan=\"5\">",
"       <p>",
"        Asymptomatic, high risk person (as designated by CHD risk-equivalent condition)*",
"       </p>",
"       <p>",
"        Asymptomatic, high risk person &gt;45 years with multiple risk factors for CHD",
"       </p>",
"      </td>",
"      <td rowspan=\"5\">",
"       <p>",
"        Sub-clinical coronary atherosclerosis is a concern",
"       </p>",
"       <p>",
"        High-risk status requires close physician follow-up and aggressive comprehensive risk factor management",
"       </p>",
"      </td>",
"      <td>",
"       Yes, if asymptomatic.",
"      </td>",
"      <td rowspan=\"5\">",
"       Annual",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1_start\">",
"       No if:",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       - Abnormal ETT&bull;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       - Ischemic changes on ECG&Delta;",
"      </td>",
"     </tr>",
"     <tr>",
"      <td class=\"sublist1\">",
"       - Functional incapacitation by one of conditions.",
"      </td>",
"     </tr>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * CHD risk equivalent is defined as presence of diabetes mellitus, peripheral vascular disease, or Framingham risk score predicting a 20 percent CHD event risk over the next 10 years.",
"     <br>",
"      &bull; Abnormal ETT is defined by an inability to exceed 6 METS (beyond completion of Stage II, or 6 minutes) on a standard Bruce protocol or the presence of ischemic symptoms and/or signs (eg, characteristic angina pain or 1 mm ST depression or elevation in 2 or more leads), inappropriate SBP and/or heart rate responses (eg, inability in the maximal heart rate to meet or exceed 85 percent of age-predicted maximal heart rate), or ventricular dysrhthymia.",
"      <br>",
"       &Delta; Ischemic ECG changes are defined by the presence of new 1 mm ST-segment elevation or depression and/or marked T wave abnormality.",
"      </br>",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Blumenthal R, Braunstein J, Connolly H, et al. Cardiovascular Advisory Panel Guidelines for the Medical Examination of Commercial Motor Vehicle Drivers, October 2002. Federal Motor Carrier Safety Administration.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
