" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Photocoagulation for macular edema slows progression to severe visual loss",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 444px; height: 263px; background-image: url(data:image/gif;base64,);\">",
