"    Cumulative rate of developing severe visual loss in untreated eyes with macular edema and eyes treated with focal laser therapy. Photocoagulation slowed the rate of severe visual loss.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Data from: Early Treatment Diabetic Retinopathy Study Research Group. Early photocoagulation for diabetic retinopathy. ETDRS report number 9. Early Treatment Diabetic Retinopathy Study Research Group.&nbsp;Ophthalmology 1991; 98:766.",
