"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic2\" style=\"width: 1040px;\">",
"  <div class=\"videoplayer\" h264=\"./images/NEURO/63510/alstnfsc_conv.mp4?title=Tongue+atrophy+and+fasciculations+in+ALS\" style=\"width:320px;height:256px\">",
"  </div>",
"  <div class=\"figure\" style=\"width: 470px\">",
"   <div class=\"ttl\">",
"    Tongue atrophy and fasciculations in a patient with amyotrophic lateral sclerosis",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 324px; height: 243px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    There is tongue atrophy and weakness. Tongue fasciculations and the characteristic \"can of worms\" appearance are evident. The patient has difficult protruding the tongue.",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Nestor Galvez-Jimenez, MD, FACP.",
"    </div>",
"   </div>",
